import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarFiveColsStyle = styled(motion.div)`
  position: absolute;
  right: 1vw;
  width: 800px;
  background-color: #f8f8ff;
  height: auto;
  padding: 20px;
  cursor: auto;
  display: flex;
  justify-content: space-between;
  display: none;
  opacity: 0;
  .section {
    display: flex;
    flex-direction: column;
    height: 350px;
    width: 150px;
    * {
      cursor: auto;
      text-decoration: none;
    }
    .cover {
      position: absolute;
      background-color: darkviolet;
      height: 100px;
      width: 150px;
    }
    .title {
      color: #679267;
      margin-top: 120px;
      margin-bottom: 10px;
    }
    span {
      color: #1f1f1f;
      cursor: pointer;
    }
  }
`;

const NavbarFiveCols = ({ controller }) => {
  return (
    <NavbarFiveColsStyle animate={controller}>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> App Name </span>
        <span>Tresom</span>
        <span>Hatity</span>
        <span>Otcom</span>
        <span>Daltfresh</span>
        <span>Duobam</span>
        <span>Mat Lam Tam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> City </span>
        <span>Nezamyslice</span>
        <span>Herzliyya</span>
        <span>Hongqi</span>
        <span>Kamakura</span>
        <span>Yahilâ€™nytsya</span>
        <span>Mandalay</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Contruction </span>
        <span>Plexiglass</span>
        <span>Plexiglass</span>
        <span>Stone</span>
        <span>Granite</span>
        <span>Glass</span>
        <span>Plexiglass</span>
      </div>
    </NavbarFiveColsStyle>
  );
};

export default NavbarFiveCols;
